import React from 'react';
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, Link, Redirect } from 'react-router-dom';

import RegisterForm from './components/RegisterForm';
import BloodRequestForm from './components/BloodRequestForm';

import { createStore, applyMiddleware } from 'redux';
import { Provider } from 'react-redux';
import rootReducer from './reducers';
import thunk from 'redux-thunk';
import '../src/assets/css';

class App extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            isLogin : false,
            user : {},
            users : [],
            donationRequest : [],
        }
    }

    render() {
        return (
            <Router>
                <div className="App">
                    <h1>Welcome to Blood Sharing!</h1>
                    <Link to="/">Home</Link> | <Link to="/donate">Donate</Link> | <Link to="/blood/request">Request</Link>
                </div>

                <div class="carousel carousel-slider center">
                    <div class="carousel-fixed-item center">
                        <a class="btn waves-effect white grey-text darken-text-2">button</a>
                    </div>
                    <div class="carousel-item red white-text" href="#one!">
                        <h2>First Panel</h2>
                        <p class="white-text">This is your first panel</p>
                    </div>
                        <div class="carousel-item amber white-text" href="#two!">
                        <h2>Second Panel</h2>
                        <p class="white-text">This is your second panel</p>
                    </div>
                        <div class="carousel-item green white-text" href="#three!">
                        <h2>Third Panel</h2>
                        <p class="white-text">This is your third panel</p>
                    </div>
                    <div class="carousel-item blue white-text" href="#four!">
                        <h2>Fourth Panel</h2>
                        <p class="white-text">This is your fourth panel</p>
                    </div>
                </div>

                <Route path="/donate" render={ props => (<RegisterForm {...props} />)} />
                <Route path="/blood/request" render={ props => (<BloodRequestForm {...props} />)} />
            </Router>
        )
    }
}

const rootElement = document.getElementById("root");
const store = createStore(rootReducer,applyMiddleware(thunk))  ;
ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  rootElement
);
